import React from 'react'
import { Icon } from "semantic-ui-react"

function Header() {
	return (
		<header style={headerStyle}>
			<p><h1>Unbranded Market </h1>
			<h1><Icon name="shopping cart" /></h1>
			</p>
		</header>
		)
}

const headerStyle = {
	background: 'navy',
	color: 'white',
	textAlign: 'center',
	padding: '5px'
}




export default Header
